import React, { useState } from "react";
import axios from "axios";
import { useNavigate } from "react-router-dom";
const EditProfile = () => {
        const [formData, setFormData] = useState({ name: "", email: "", phone: "", address: "" });
        const navigate = useNavigate();

        const handleChange = (e) => {
                setFormData({ ...formData, [e.target.name]: e.target.value });
        };

        const handleSubmit = async (e) => {
                e.preventDefault();
                try {
                        const token = localStorage.getItem("userToken");
                        await axios.put("http://localhost:5000/api/users/me", formData, {
                                headers: { Authorization: `Bearer ${token}` },
                        });
                        navigate("/profile");
                } catch (error) {
                        console.error("Error updating profile:", error);
                }
        }; return (
                <div className="bg-gray-100">
                        {/* Hero Section */}
                        <div className="relative bg-white">
                                <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
                                        <div className="lg:grid lg:grid-cols-12 lg:gap-8 lg:items-center py-20">
                                                <div className="sm:text-center md:max-w-2xl md:mx-auto lg:col-span-6">
                                                        <h1 className="text-4xl font-extrabold tracking-tight text-gray-900 sm:text-5xl">
                                                                Discover the Latest Trends
                                                        </h1>
                                                        <p className="mt-4 text-lg text-gray-600">
                                                                Find the best products with exclusive offers, all in one place.
                                                        </p>
                                                        <div className="mt-6">
                                                                <a
                                                                        href="/products"
                                                                        className="px-6 py-3 text-lg font-semibold text-white bg-blue-600 rounded-lg shadow-md hover:bg-blue-700"
                                                                >
                                                                        Shop Now
                                                                </a>
                                                        </div>
                                                </div>
                                                <div className="mt-10 relative lg:mt-0 lg:col-span-6">
                                                        <img
                                                                className="w-full rounded-lg shadow-xl"
                                                                src="https://source.unsplash.com/600x400/?shopping,ecommerce"
                                                                alt="Ecommerce"
                                                        />
                                                </div>
                                        </div>
                                </div>
                        </div>

                        {/* Featured Products */}
                        <div className="py-16 bg-gray-100">
                                <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
                                        <h2 className="text-3xl font-extrabold text-gray-900 text-center">
                                                Featured Products
                                        </h2>
                                        <div className="mt-6 grid gap-6 sm:grid-cols-2 lg:grid-cols-3 xl:grid-cols-4">
                                                {[1, 2, 3, 4].map((item) => (
                                                        <div
                                                                key={item}
                                                                className="bg-white p-6 rounded-lg shadow-md hover:shadow-lg"
                                                        >
                                                                <img
                                                                        src={`https://source.unsplash.com/300x200/?product,fashion${item}`}
                                                                        alt="Product"
                                                                        className="w-full h-40 object-cover rounded-md"
                                                                />
                                                                <h3 className="mt-4 text-lg font-semibold text-gray-900">
                                                                        Product {item}
                                                                </h3>
                                                                <p className="mt-2 text-gray-600">$99.99</p>
                                                                <a
                                                                        href="/product"
                                                                        className="mt-4 block text-blue-600 hover:text-blue-800 font-medium"
                                                                >
                                                                        View Details
                                                                </a>
                                                        </div>
                                                ))}
                                        </div>
                                </div>
                        </div>

                        {/* Testimonials */}
                        <div className="py-16 bg-white">
                                <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
                                        <h2 className="text-3xl font-extrabold text-gray-900 text-center">
                                                What Our Customers Say
                                        </h2>
                                        <div className="mt-6 grid gap-6 sm:grid-cols-2 lg:grid-cols-3">
                                                {[1, 2, 3].map((item) => (
                                                        <div
                                                                key={item}
                                                                className="p-6 bg-gray-100 rounded-lg shadow-md hover:shadow-lg"
                                                        >
                                                                <p className="text-gray-700 italic">
                                                                        "Amazing products! The quality is top-notch."
                                                                </p>
                                                                <div className="mt-4 flex items-center space-x-4">
                                                                        <img
                                                                                src={`https://source.unsplash.com/50x50/?person${item}`}
                                                                                className="w-12 h-12 rounded-full"
                                                                                alt="Customer"
                                                                        />
                                                                        <div>
                                                                                <h4 className="font-semibold text-gray-900">Customer {item}</h4>
                                                                                <p className="text-sm text-gray-600">Verified Buyer</p>
                                                                        </div>
                                                                </div>
                                                        </div>
                                                ))}
                                        </div>
                                </div>
                        </div>
                </div>
        );
};

export default Home;
